// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract IPFSManagement is Initializable, UUPSUpgradeable, OwnableUpgradeable {

    struct UserFile {
        bytes32 fileName;
        uint256 changeDate;
        address owner;
        bool status;
        uint index;
    }

    event AddFile (
        string fileHash,
        bytes32 fileName,
        address owner,
        uint256 uploadDate
    );

    event RemoveFile (
        string fileHash,
        address owner,
        uint256 removeDate
    );

    mapping (address => mapping(string => UserFile)) fileDetailsByUser;
    mapping (address => string[]) fileByUser;

    function initialize() initializer public {
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    function _authorizeUpgrade(address) internal override onlyOwner {}

    function addFile (string memory fileHash, bytes32 fileName) external {
        require(fileDetailsByUser[msg.sender][fileHash].changeDate == 0, "File already registered");

        fileByUser[msg.sender].push(fileHash);
        fileDetailsByUser[msg.sender][fileHash].fileName = fileName;
        fileDetailsByUser[msg.sender][fileHash].owner = msg.sender;
        fileDetailsByUser[msg.sender][fileHash].changeDate = block.timestamp;
        fileDetailsByUser[msg.sender][fileHash].status = true;
        fileDetailsByUser[msg.sender][fileHash].index = fileByUser[msg.sender].length;

        emit AddFile(fileHash, fileName, msg.sender, block.timestamp);
    }

    function removeFile (string memory fileHash) external {
        require(fileDetailsByUser[msg.sender][fileHash].changeDate > 0, "File does not exist");
        require(fileDetailsByUser[msg.sender][fileHash].status, "File already deleted");

        fileDetailsByUser[msg.sender][fileHash].status = false;
        fileDetailsByUser[msg.sender][fileHash].changeDate = block.timestamp;

        emit RemoveFile(fileHash, msg.sender, block.timestamp);
    }

    function checkAccess (address user, string memory fileHash) external view returns (bool) {
        require(fileDetailsByUser[user][fileHash].changeDate > 0, "File does not exist");
        require(fileDetailsByUser[user][fileHash].status, "File already deleted");

        if (fileDetailsByUser[user][fileHash].owner == user) {
            return true;
        }

        return false;
    }

    function fileIsAvailable (address user, string memory fileHash) external view returns (bool) {
        require(fileDetailsByUser[user][fileHash].changeDate > 0, "File does not exist");

        return fileDetailsByUser[user][fileHash].status;
    }

    function getFiles (address user) external view returns (string[] memory, bytes32[] memory) {
        string[] memory _filesByUser = fileByUser[user];

        string[] memory hashes_ = new string[](_filesByUser.length);
        bytes32[] memory names_ = new bytes32[](_filesByUser.length);

        for (uint i = 0; i < _filesByUser.length; i++) {
            if (fileDetailsByUser[user][_filesByUser[i]].status) {
                hashes_[i] = _filesByUser[i];
                names_[i] = fileDetailsByUser[user][_filesByUser[i]].fileName;
            }
        }

        return (hashes_, names_);
    }

    function getAddressFromSignature (uint8 sigV, bytes32 sigR, bytes32 sigS, bytes32 hash) public pure 
        returns (address) {
        address user = ecrecover(hash, sigV, sigR, sigS);
        require(user != address(0x0) && user != address(0x0));

        return user;
    }
}
